    When youre booking the car, you just need a debit or credit card.

At the rental counter, youll need:

<li>Your passport</li> 
<li>Your voucher</li> 
<li>Each drivers driving licence</li>  
<li>The main drivers credit card (some rental companies also accept debit cards, but most dont).</li> 
Important: Please make sure you check the cars rental terms as well, as each rental company has its own rules. For example? They might need to see some extra ID. They might not accept certain types of credit card. Or they might not rent to any driver who hasnt held their driving licence for 36 months or more.
