  <AccordionItem>
    <h2>
      <AccordionButton>
        <Box as="span" flex='1' textAlign='left' padding='5px' backgroundColor='white'>
          Can I book a car for my partner, friend, colleague, etc?
        </Box>
        <AccordionIcon />
      </AccordionButton>
