   <li>Think about where youre going. An SUV might be great for cruising down a Texas freeway, but a smaller cars probably much easier to drive in Rome.</li>
   <li>See what other people think. Youll find lots of reviews and ratings on our site, so find out what other customers liked (and didnt like) about each rental company.</li>
   <li>Dont forget the gearbox. In some countries, nearly everyone drives a manual car. In others, automatics are the norm. Make sure you rent one you can drive!</li>

